import "./App.css";
import { useState } from "react";
import AxiosRoutes from "./Routes/AxiosRoutes";
import GlobalVar from "./GlobalVariables/GlobalVaraiables";

function App() {
  //Open the hidden delete button
  const openDelete = () => {
    if (GlobalVar.hiddenBttn) {
      GlobalVar.setHiddenBttn(false);
    } else if (!GlobalVar.hiddenBttn) {
      GlobalVar.setHiddenBttn(true);
    }
  };

  return (
    <div className="App">
      <h1>Employee Database</h1>
      <div className="inputs">
        <label>Name:</label>
        <input
          type="text"
          onChange={(event) => {
            GlobalVar.setName(event.target.value);
          }}
        />
        <label>Age:</label>
        <input
          type="number"
          onChange={(event) => {
            GlobalVar.setAge(event.target.value);
          }}
        />
        <label>Country:</label>
        <input
          type="text"
          onChange={(event) => {
            GlobalVar.setCountry(event.target.value);
          }}
        />
        <label>Position:</label>
        <input
          type="text"
          onChange={(event) => {
            GlobalVar.setPosition(event.target.value);
          }}
        />
        <label>Wage per hr:</label>
        <input
          type="number"
          onChange={(event) => {
            GlobalVar.setWage(event.target.value);
          }}
        />
        <label>Manager ID:</label>
        <input
          type="number"
          onChange={(event) => {
            GlobalVar.setManagerID(event.target.value);
          }}
        />
        <button className="infoBttn" onClick={AxiosRoutes.addEmployee}>
          Add Employee
        </button>
      </div>

      <div className="inputs">
        <label>First Name:</label>
        <input
          type="text"
          onChange={(event) => {
            GlobalVar.setFirstName(event.target.value);
          }}
        />
        <label>Last Name:</label>
        <input
          type="text"
          onChange={(event) => {
            GlobalVar.setLastName(event.target.value);
          }}
        />
        <label>Employee ID:</label>
        <input
          type="number"
          onChange={(event) => {
            GlobalVar.setEmpID(event.target.value);
          }}
        />

        <button className="infoBttn" onClick={AxiosRoutes.addManager}>
          Add Manager
        </button>
      </div>

      <div className="employees">
        <div className="employeeHeader">
          <div>Display All Employees By: </div>

          <div className="employeeHeaderBttns">
            {" "}
            <div className="headerBttnGroup">
              {" "}
              <div>Name</div>
              <button onClick={AxiosRoutes.getEmployeesName}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_down
                </span>
              </button>
              <button onClick={AxiosRoutes.getEmployeesNameDesc}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_up
                </span>
              </button>
            </div>
            <div className="headerBttnGroup">
              {" "}
              <div className="headerBttnGroupTitle">Age</div>
              <button onClick={AxiosRoutes.getEmployeesAge}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_down
                </span>
              </button>
              <button onClick={AxiosRoutes.getEmployeesAgeDesc}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_up
                </span>
              </button>
            </div>
            <div className="headerBttnGroup">
              {" "}
              <div className="headerBttnGroupTitle">Country</div>
              <button onClick={AxiosRoutes.getEmployeesCountry}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_down
                </span>
              </button>
              <button onClick={AxiosRoutes.getEmployeesCountryDesc}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_up
                </span>
              </button>
            </div>
            <div className="headerBttnGroup">
              <div className="headerBttnGroupTitle">Position</div>
              <button onClick={AxiosRoutes.getEmployeesPosition}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_down
                </span>
              </button>
              <button onClick={AxiosRoutes.getEmployeesPositionDesc}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_up
                </span>
              </button>
            </div>
            <div className="headerBttnGroup">
              <div className="headerBttnGroupTitle">Wage</div>
              <button onClick={AxiosRoutes.getEmployeesWage}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_down
                </span>
              </button>
              <button onClick={AxiosRoutes.getEmployeesWageDesc}>
                <span className="material-symbols-outlined">
                  keyboard_double_arrow_up
                </span>
              </button>
            </div>
          </div>
        </div>

        <div className="searchBy">
          Search by:
          <button
            onClick={() => {
              GlobalVar.setNameOn(true);
              GlobalVar.setAgeOn(false);
              GlobalVar.setCountryOn(false);
              GlobalVar.setPositionOn(false);
              GlobalVar.setWageOn(false);
            }}
          >
            Name
          </button>
          <button
            onClick={() => {
              GlobalVar.setNameOn(false);
              GlobalVar.setAgeOn(true);
              GlobalVar.setCountryOn(false);
              GlobalVar.setPositionOn(false);
              GlobalVar.setWageOn(false);
            }}
          >
            Age
          </button>
          <button
            onClick={() => {
              GlobalVar.setNameOn(false);
              GlobalVar.setAgeOn(false);
              GlobalVar.setCountryOn(true);
              GlobalVar.setPositionOn(false);
              GlobalVar.setWageOn(false);
            }}
          >
            Country
          </button>
          <button
            onClick={() => {
             GlobalVar. setNameOn(false);
              setAgeOn(false);
              setCountryOn(false);
              setPositionOn(true);
              setWageOn(false);
            }}
          >
            Position
          </button>
          <button
            onClick={() => {
              setNameOn(false);
              setAgeOn(false);
              setCountryOn(false);
              setPositionOn(false);
              setWageOn(true);
            }}
          >
            Wage
          </button>
        </div>

        {nameOn && (
          <div className="searchBar">
            {" "}
            Name:{" "}
            <input
              type="text"
              onChange={(event) => {
                setNameInput(event.target.value);
              }}
            />
            <button
              onClick={() => {
                AxiosRoutes.getName(nameInput);
              }}
            >
              Search
            </button>
          </div>
        )}
        {ageOn && (
          <div className="searchBar">
            {" "}
            Age:{" "}
            <input
              type="number"
              onChange={(event) => {
                setAgeInput(event.target.value);
              }}
            />
            <button
              onClick={() => {
                AxiosRoutes.getAge(ageInput);
              }}
            >
              Search
            </button>
          </div>
        )}
        {countryOn && (
          <div className="searchBar">
            {" "}
            Country:{" "}
            <input
              type="text"
              onChange={(event) => {
                setCountryInput(event.target.value);
              }}
            />
            <button
              onClick={() => {
                AxiosRoutes.getCountry(countryInput);
              }}
            >
              Search
            </button>
          </div>
        )}
        {positionOn && (
          <div className="searchBar">
            {" "}
            Position:{" "}
            <input
              type="text"
              onChange={(event) => {
                setPositionInput(event.target.value);
              }}
            />
            <button
              onClick={() => {
                AxiosRoutes.getPosition(positionInput);
              }}
            >
              Search
            </button>
          </div>
        )}
        {wageOn && (
          <div className="searchBar">
            {" "}
            Wage:{" "}
            <input
              type="number"
              onChange={(event) => {
                setWageInput(event.target.value);
              }}
            />
            <button
              onClick={() => {
                AxiosRoutes.getWage(wageInput);
              }}
            >
              Search
            </button>
          </div>
        )}

        {employeeList.map((val, index) => {
          return (
            <div className="employee">
              <div className="itemHolder">
                <div className="item"> Employee ID:</div>
                <div className="item"> {val.id}</div>
              </div>
              <div className="itemHolder">
                <div className="item"> Name:</div>
                <div className="item">
                  {" "}
                  {val.name}
                  <div className="newWageHolder">
                    <input
                      className="newInput"
                      type="text"
                      placeholder="new name"
                      onChange={(event) => {
                        setNewName(event.target.value);
                      }}
                    />
                    <button
                      onClick={() => {
                        AxiosRoutes.updateEmployeeName(val.id);
                      }}
                    >
                      {" "}
                      Update
                    </button>
                  </div>
                </div>
              </div>
              <div className="itemHolder">
                <div className="item">Age:</div>
                <div className="item">
                  {val.age}
                  <div className="newWageHolder">
                    <input
                      className="newInput"
                      type="text"
                      placeholder="new age"
                      onChange={(event) => {
                        setNewAge(event.target.value);
                      }}
                    />
                    <button
                      onClick={() => {
                        AxiosRoutes.updateEmployeeAge(val.id);
                      }}
                    >
                      {" "}
                      Update
                    </button>
                  </div>
                </div>
              </div>

              <div className="itemHolder">
                <div className="item">Country:</div>
                <div className="item">{val.country}</div>
                <div className="newWageHolder">
                  <input
                    className="newInput"
                    type="text"
                    placeholder="new country"
                    onChange={(event) => {
                      setNewCountry(event.target.value);
                    }}
                  />
                  <button
                    onClick={() => {
                      AxiosRoutes.updateEmployeeCountry(val.id);
                    }}
                  >
                    {" "}
                    Update
                  </button>
                </div>{" "}
              </div>
              <div className="itemHolder">
                {" "}
                <div className="item">Position:</div>{" "}
                <div className="item">{val.position}</div>
                <div className="newWageHolder">
                  <input
                    className="newInput"
                    type="text"
                    placeholder="new position"
                    onChange={(event) => {
                      setNewPosition(event.target.value);
                    }}
                  />
                  <button
                    onClick={() => {
                      AxiosRoutes.updateEmployeePosition(val.id);
                    }}
                  >
                    {" "}
                    Update
                  </button>
                </div>
              </div>
              <div className="itemHolder">
                {" "}
                <div className="item"> Wage:</div>{" "}
                <div className="item"> ${val.wage}hr</div>
                <div className="newWageHolder">
                  <input
                    className="newInput"
                    type="text"
                    placeholder="new wage"
                    onChange={(event) => {
                      setNewWage(event.target.value);
                    }}
                  />
                  <button
                    onClick={() => {
                      AxiosRoutes.updateEmployeeWage(val.id);
                    }}
                  >
                    {" "}
                    Update
                  </button>
                </div>
              </div>

              <div className="deleteBttn">
                {" "}
                <button
                  key={val.id}
                  onClick={() => {
                    openDelete();
                  }}
                >
                  Delete Employee
                </button>
                {hiddenBttn && (
                  <div>
                    Are you sure?
                    <button
                      onClick={() => {
                        AxiosRoutes.deleteEmployee(val.id);
                      }}
                    >
                      yes
                    </button>
                  </div>
                )}
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default App;
